import axios from 'axios';
import React, { useState, useEffect } from 'react';

const Derbies = () => {

    const shoe = [{
        name: 'The Derbies',
        img: 'derbies.png',
        price: 'Rs 2,999'
    }]


    return (
        <div className="derbies">
            <div className="derbies-img">
                <img>{shoe.img}</img>
            </div>
            <h1>{shoe.name}</h1>
            <p>{shoe.price}</p>
        </div>
    );
}

export default Derbies;
